import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
      <nav className="navbar">
        <h1>My Soul Journal</h1>
        <div className="links">
          <Link to="/">Home</Link>
          <Link to="/create">New Journal</Link>
        </div>
      </nav>
    );
  }
   
  export default Navbar;
